(function() {

	'use strict';

	var AuthService = function($firebase, $firebaseAuth, FIREBASE_URL, $q) {
		var ref = new Firebase(FIREBASE_URL);
		var authRef = $firebaseAuth(ref);

		this.auth = function() {
			return authRef;
		};

		this.getAuth = function() {
			return authRef.$getAuth();
		};

		this.logOut = function() {
			authRef.$unauth();
		};

		this.signin = function(user) {
			var deferred = $q.defer();
			var self = this;

			authRef.$authWithPassword({
				"email": user.email,
				"password": user.password
			}).then(function(authData) {
				deferred.resolve(authData);
			}, function(error) {
				deferred.reject(error);
			});
			return deferred.promise;
		};

		this.isSignedIn = function() {
			return authRef.$getAuth() != null ? true : false;
		};

		this.confirmPassword = function(password1, password2) {
			var deferred = $q.defer();

			if(password1 == password2) {
				deferred.resolve();
			} else {
				var error = {code: 'PASSWORD_NOT_CONFIRMED', message: 'Passwords does not match. Please try again' };
				deferred.reject(error);
			};

			return deferred.promise;
		};

		this.signup = function(user){
			var deferred = $q.defer();
			authRef.$createUser({
				email: user.email,
				password: user.password,
				restaurantName : user.restaurantName
			}).then(function(userData) {
				return authRef.$authWithPassword({
					email: user.email,
					password: user.password
				});
			}).then(function(authData) {
				deferred.resolve(authData);
			}).catch(function(error) {
				deferred.reject(error);
			});
			return deferred.promise;
		};

		this.signupOAuth = function(provider){
			var deferred = $q.defer();

			authRef.$authWithOAuthPopup(provider, { scope: "email" })
			.then(function(authData) {
				deferred.resolve(authData);
			})
			.catch(function(error) {
				// Fix for Chrome iOS which doesn't support pop-up auth
				if (error.code === "TRANSPORT_UNAVAILABLE") {
				     authRef.$authWithOAuthRedirect(provider, { scope: "email" })
				     .then(function(authData) {
				     	deferred.resolve(authData);
				     })
				     .catch(function(error) {
				     	deferred.reject(error);
				     });
			   } else {
			   		deferred.reject(error);
			   };
			});

			return deferred.promise;
		}

		this.forgotPassword = function(email) {
			var authRef = $firebaseAuth(ref);
			var deferred = $q.defer();
			authRef.$resetPassword({
			    email : email })
				.then(function() {
					console.log("Password reset email sent successfully");
					deferred.resolve();
				}).catch(function(error) {
					console.log("Error sending password reset email:", error);
					deferred.reject(error);
				});
			return deferred.promise;
		};

		this.changePassword = function(currentEmail, currentPassword, newPassword) {
			var authRef = $firebaseAuth(ref);
			var deferred = $q.defer();
			authRef.$changePassword({
				email    : currentEmail,
				oldPassword : currentPassword,
				newPassword : newPassword
				})
				.then(function() {
					console.log("Password Updated!");
					deferred.resolve();
				}).catch(function(error) {
					console.log("Password Update Error", error);
					deferred.reject(error);
				});
			return deferred.promise;
		};

		this.changeEmail = function(currentEmail, currentPassword, newEmail) {
			var authRef = $firebaseAuth(ref);
			var deferred = $q.defer();
			authRef.$changeEmail({
				oldEmail    : currentEmail,
				newEmail    : newEmail,
				password : currentPassword
				})
				.then(function() {
					console.log("Email Updated!");
					deferred.resolve();
				}).catch(function(error) {
					console.log("Email Update Error", error);
					deferred.reject(error);
				});
			return deferred.promise;
		};


		this.removeUser = function(currentEmail, currentPassword) {
			var authRef = $firebaseAuth(ref);
			var deferred = $q.defer();
			authRef.$removeUser({
				email    : currentEmail,
				password : currentPassword
				})
				.then(function() {
					console.log("User Deleted");
					deferred.resolve();
				}).catch(function(error) {
					console.log("User Deletion Error!", error);
					deferred.reject(error);
				});
			return deferred.promise;
		};

	};

	angular
		.module('waitlisterApp')
		.service('AuthService', [
			'$firebase',
			'$firebaseAuth',
			'FIREBASE_URL', 
			'$q', 
			AuthService
		]);

})();
(function(){

	var RestaurantFactory = function($firebase, FIREBASE_URL, $q, $filter) {
		
		var Restaurant = {
			/*jshint camelcase: false */
			create: function(restaurantData, uid) {
				var deferred = $q.defer();
				var restaurantId = restaurantData.restaurantName.replace(/ /g,'').toLowerCase();
				var restaurantRef = new Firebase(FIREBASE_URL + "restaurants/" + restaurantId);
				
				// Check if restaurant with same name already exists
				restaurantRef.once('value', function(snapshot) {
					if(snapshot.exists()) {
						// Append id with random number between 1-100
						restaurantRef = new Firebase(FIREBASE_URL + "restaurants/" + restaurantId + Math.ceil(Math.random()*100));
					};
					
					// var restaurantRef = $firebase(ref);
				
					var smsReadyText = "Hi {name}, \n\n"
							+ "Your table at " + restaurantData.restaurantName + " is now ready. " +
							"Please check back in 5 min or call " + $filter('telFilter')(restaurantData.phone) + ".";

					var smsConfirmText = "Voila! You're waitlisted to " + restaurantData.restaurantName +
							" - " + $filter('telFilter')(restaurantData.phone) + ".\n\n" +
							"View your turn in line here: waitlister.firebaseapp.com/#/waitlist/" + restaurantId;

					var onComplete = function(error) {
					  if (error) {
					    deferred.reject(error)
					  } else {
					    $firebase(restaurantRef).$asObject().$loaded()
					    	.then(function(restaurantObj) {
					    		deferred.resolve(restaurantObj);
					    	})
					    	.catch(function(error) {
					    		deferred.reject(error)
				    	})
					  }
					};

					restaurantRef.set({
						userId: uid,
						priority: Date.now(),
						restaurantName: restaurantData.restaurantName,
						email: restaurantData.email,
						phone: restaurantData.phone,
						address: "",
						customersServed: 0,
						customersSMS: 0,
						customersNoShows: 0,
						smsReadyText: smsReadyText,
						smsConfirmText: smsConfirmText
					}, onComplete);

					return deferred.promise;
				});
			},

			isNotExisting: function(uid) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + 'restaurants');
				var restaurantsArray = $firebase(ref).$asArray();

				restaurantsArray.$loaded()
					.then(function(restaurants) {
						var restaurant = _.find(restaurants, function(restaurant) {
						    return restaurant.userId == uid; 
						});

						if(restaurant) {
							// var restaurantObj = restaurant.$id)).$asObject().$loaded();
							var error = {code: "EXISTING_RESTAURANT"};
							deferred.reject(error);
						} else {
							deferred.resolve();
						}
					})
					.catch(function(error) {
						deferred.reject(error);
					})

				return deferred.promise;
			},

			get: function(restaurantId) {
				var deferred = $q.defer();

				var ref = new Firebase(FIREBASE_URL + 'restaurants/' + restaurantId);
				var restaurantRef = $firebase(ref).$asObject();

				restaurantRef.$loaded()
					.then(function(restaurant) {
						deferred.resolve(restaurant);
					})
					.catch(function(error) {
						deferred.reject(error);
					})

				return deferred.promise;
			},

			getFromAuth: function(uid) {
				var deferred = $q.defer();

				var ref = new Firebase(FIREBASE_URL + 'restaurants');
				var restaurantsArray = $firebase(ref).$asArray();

				restaurantsArray.$loaded()
					.then(function(restaurants) {
						var restaurant = _.find(restaurants, function(restaurant) {
						    return restaurant.userId == uid; 
						})

						return $firebase(ref.child(restaurant.$id)).$asObject().$loaded();
					})
					.then(function(restaurantObj) {
						deferred.resolve(restaurantObj);
					})
					.catch(function(error) {
						deferred.reject(error);
					})

				return deferred.promise;
			},

			getParties: function(restaurantId) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "restaurants/" + restaurantId + "/parties");
				var partiesRef = $firebase(ref).$asArray();
				partiesRef.$loaded()
					.then(function(parties) {
						deferred.resolve(parties)
					})
					.catch(function(error) {
						deferred.reject(error);
				})

				return deferred.promise;
			},

			addParty: function(party, restaurantId, restaurantName) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "restaurants/" + restaurantId + "/parties/" + party.phone);
				var partiesRef = $firebase(ref);

				partiesRef.$set({
					priority: Date.now(),
					dateCreated: Date.now(),
					restaurantName: restaurantName,
					phone: party.phone,
					notified: false,
					name: party.name,
					size: party.size.value,
					notes: party.notes || ""
				})
					.then(function() {
						return partiesRef.$asObject().$loaded();
					})
					.then(function(partyObj) {
						deferred.resolve(partyObj);
					})
					.catch(function(error) {
						deferred.reject(error);
				});
					
				return deferred.promise;
			},

			setPartyNotified: function(partyId, smsId, restaurantId) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "restaurants/" + restaurantId + "/parties/" + partyId);
				var partyObj = $firebase(ref).$asObject();

				partyObj.$loaded()
					.then(function(partyObj) {
						partyObj.notified = true;
						partyObj.smsId = smsId;
						return partyObj.$save();
					})
					.then(function(partyObj) {
						deferred.resolve(partyObj)
					})
					.catch(function(error) {
						deferred.reject(error);
				});

				return deferred.promise;
			},

			addStat: function(restaurantId, stat) {
				var deferred = $q.defer();
				var today = new Date().toISOString().substring(0, 10);
				var ref = new Firebase(FIREBASE_URL + "restaurants/" + restaurantId + "/stats/" + today);
				var restaurantStatRef = $firebase(ref).$asObject();
				
				restaurantStatRef.$loaded()
					.then(function(restaurantStat) {
						restaurantStat[stat] ? 
						    restaurantStat[stat]++ : 
						    restaurantStat[stat] = 1;
						return restaurantStat.$save();
					})
					.then(function(restaurantStat) {
						deferred.resolve(restaurantStat)
					})
					.catch(function(error) {
						deferred.reject(error);
				});

					
				return deferred.promise;
			}

		};

		return Restaurant;

	};
	angular
		.module('waitlisterApp')
		.factory('Restaurant', [
			'$firebase',
			'FIREBASE_URL', 
			'$q', 
			'$filter',
			RestaurantFactory
		]);
})();
