(function(){

  var smsFactory = function(FIREBASE_URL, $firebase, $q) {
      // Replace variables with values in SMS text
      // TODO: Come up with a more elegant solution
      function smsInsertVariables(smsText, restaurant, party) {
        var regexName = /\{name\}/gi;
        var regexPartySize = /\{partySize\}/gi;
        var regexNotes = /\{notes\}/gi;
        // var regexRestaurantName = /\{restaurantName\}/gi;
        // var regexPhone = /\{phone\}/gi;
        // var regexAddress = /\{address\}/gi;
        // var regexUrl = /\{url\}/gi;

        return smsText
          .replace(regexName, party.name)
          .replace(regexPartySize, party.size)
          .replace(regexNotes, party.notes || 'notes')
          // .replace(regexRestaurantName, restaurant.restaurantName)
          // .replace(regexPhone, restaurant.phone)
          // .replace(regexAddress, restaurant.address)
          // .replace(regexUrl, "waitlister.firebaseapp.com/#/waitlist/" + restaurant.$id);
      }

      var SMS = {
        sendReadyText: function(party, restaurant) {
          var deferred = $q.defer();
          var smsRef = $firebase(new Firebase(FIREBASE_URL + 'sms' + '/ready'));

          var smsText = smsInsertVariables(restaurant.smsReadyText, restaurant, party)
          
          smsRef.$push({
            created: new Date().getTime(),
            name: party.name,
            partyId: party.$id,
            phone: party.phone,
            restaurantName: party.restaurantName,
            size: party.size,
            text: smsText
          })
            .then(function(smsRef) {
              deferred.resolve(smsRef);
            })
            .catch(function(error) {
              deferred.reject(error);
          });

          return deferred.promise;
        },
        sendConfirmedText: function(party, restaurant) {
          var deferred = $q.defer();
          var smsRef = $firebase(new Firebase(FIREBASE_URL + 'sms' + '/confirmed'));
      
          var smsText = smsInsertVariables(restaurant.smsConfirmText, restaurant, party)

          smsRef.$push({
            created: new Date().getTime(),
            name: party.name,
            partyId: party.$id,
            phone: party.phone,
            restaurantName: party.restaurantName,
            size: party.size,
            text: smsText
          })
          .then(function(smsRef) {
            deferred.resolve(smsRef);
          })
          .catch(function(error) {
            deferred.reject(error);
          });

          return deferred.promise;
        }

      };

      return SMS;
    };


  angular.module('waitlisterApp')
  .factory('SMS', [
    'FIREBASE_URL', 
    '$firebase', 
    '$q',
    smsFactory
  ])

})();
(function(){

	var guestsFactory = function($firebase, FIREBASE_URL, $q, _){
		var Guests = {

			get: function(restaurantId) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "guests/" + restaurantId);
				var guestsArray = $firebase(ref).$asArray();
				guestsArray.$loaded()
					.then(function(guests) {
						deferred.resolve(guests)
					})
					.catch(function(error) {
						deferred.reject(error);
				})

				return deferred.promise;
			},
			add: function(party, restaurantId) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "guests/" + restaurantId + "/" + party.$id);
				
				var guest = $firebase(ref).$asObject()

				guest.$loaded()
					.then(function(guest) {
						guest.$priority = Date.now();
						guest.lastServed = Date.now();
						guest.lastWaitTime = Date.now() - party.dateCreated;
						guest.visits ?
							guest.visits++ :
							guest.visits = 1;
						// Calculate Average wait time
						guest.averageWaitTime = guest.averageWaitTime ? 
							(guest.averageWaitTime * (guest.visits - 1) + guest.lastWaitTime)/guest.visits :
							 guest.lastWaitTime;
						console.log(guest.averageWaitTime);
						guest.name = party.name;
						guest.phone = party.phone;
						// TODO: Fix avg party size :/
						guest.averagePartySize = guest.averagePartySize ? 
							(guest.averagePartySize * (guest.visits - 1) + party.size) / guest.visits :
							 party.size;
						console.log(guest.averagePartySize);
						
						return guest.$save()
					})
					.then(function(guest) {
						deferred.resolve(guest)
					})
					.catch(function(error) {
						deferred.reject(error);
					})
				
				return deferred.promise;
			},

			add2: function(party, restaurantId) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "guests/" + restaurantId);
				var guestsArray = $firebase(ref).$asArray();

				// Set how long it took to be waited
				party.dateServed = Date.now();
				party.waitTime = Date.now() - party.dateCreated;

				guestsArray.$loaded()
					.then(function(guests) {
						return guests.$add(party)
					})
					.then(function(guests) {
						deferred.resolve(guests)
					})
					.catch(function(error) {
						deferred.reject(error);
				})

				return deferred.promise;
			},

			getWaitTime: function(restaurantId) {
				var deferred = $q.defer();
				var ref = new Firebase(FIREBASE_URL + "guests/" + restaurantId);
				var guestsArray = $firebase(ref).$asArray();
				var totalWaitTime = 0;
				var avgWaitTime = {exactMs: 0, roundedMins: 0};

				guestsArray.$loaded()
					.then(function(guests) {
						if (guests.length > 0) {
							angular.forEach(guests, function(guest, index) {
								totalWaitTime = totalWaitTime + guest.averageWaitTime;
							})
							
							avgWaitTime.exactMs = totalWaitTime/guests.length;
							avgWaitTime.roundedMins = Math.ceil((totalWaitTime/guests.length)/60000);
						};

						deferred.resolve(avgWaitTime)
					})
					.catch(function(error) {
						deferred.reject(error);
				})

				return deferred.promise;
			},
			getTopRegular: function(uid) {
				var deferred = $q.defer();
				var guestsArray = Guests.get(uid)
					.then(function(guests) {
						console.log(guests);

						var o = { freq: { }, most: '' };
						_(guests).each(function(s) {
						    o.freq[s] = (o.freq[s] || 0) + 1;
						    if(!o.freq[o.most] || o.freq[s] > o.freq[o.most])
						        o.most = s;
						});

						console.log(o);
						deferred.resolve(guestsArray)
					})
					.catch(function(error) {
						deferred.reject(error);
				});

				return deferred.promise;
			}
		};

		return Guests;
	};

	angular.module('waitlisterApp')
	.factory('Guests', [
		'$firebase', 
		'FIREBASE_URL', 
		'$q',
		'_',
		guestsFactory
	]);
})();
(function() {
	'use strict';

	var LoginCtrl = function($state, $timeout, AuthService, Restaurant, $modal, $q, Notification){
		this.user = {};
		this.loading = false;
		self = this;

		this.signup = function(formData) {
			self.alert = false;
			self.loading = true;

			// AuthService.confirmPassword(formData.password, formData.password2)
			// .then(function() {
			// 	return AuthService.signup(formData);
			// })
			AuthService.signup(formData)
				.then(function (createdUser) {
					return Restaurant.create(formData, AuthService.getAuth().uid);
				})
				.then(function (restaurant){
					$state.go('waitlist');
					Notification.success({message: 'Welcome!', delay: 2000});
				})
				.catch(function(error) {
					self.loading = false;

				    self.alert = {
				    	type: "error", 
				    	message: error.message, 
				    	code: error.code
				    };
			  	});
		};
		
		this.signupOAuth = function(service) {
			this.alert = false;
			var auth;

			AuthService.signupOAuth(service)
				.then(function (authData) {
					auth = authData;
					return Restaurant.isNotExisting(AuthService.getAuth().uid);
				})
				.then(function () {
					return confirmRestaurantModal(auth[service].email);
				})
				.catch(function(error) {
					// self.loading = false;
					if (error.code == "EXISTING_RESTAURANT") {
						$state.go('waitlist');
						Notification.success({message: 'Welcome!', delay: 2000});
					} else {
						self.alert = {
							type: "error", 
							message: error.message, 
							code: error.code
						};
					};
			  	});
		};

		function confirmRestaurantModal(email) {
			var deferred = $q.defer();
			
			var modalInstance = $modal.open({
				templateUrl: 'modules/login/confirmRestaurantModal.html',
				controller: 'ConfirmRestaurantModalCtrl',
				controllerAs: 'confirmRestaurant',
				windowClass: 'vertical-center',
                backdrop: 'static'
	      	});

		  	modalInstance.result
		  		.then(function (formData) {
		  			formData.email = email;
	  				return Restaurant.create(formData, AuthService.getAuth().uid);
		  		})
		  		// .then(function (){
		  		// 	return User.create(email, AuthService.getAuth().uid);
		  		// })
		  		.then(function() {
		  			$state.go('waitlist');
		  			deferred.resolve();
		  		})
		  		.catch(function(error) {
		  			self.loading = false;
	  				self.alert = {
	  					type: "error", 
	  					message: "Please enter a restaurant name to continue. Try signing in again.", 
	  					code: "INVALID_RESTAURANT_NAME"
  					};
  					AuthService.logOut();

  					deferred.reject(error);
	  		});

  			deferred.promise;
		};

		this.login = function(user) {
			this.alert = false;
			this.loading = true;
			
			AuthService.signin(user)
				.then(function (){
					$state.go('waitlist');
					Notification.success({message: 'Welcome!', delay: 2000});
				}, function (error) {
					self.loading = false;
					self.alert = {
						type: "error", 
						message: error.message, 
						code: error.code
					};
			});
		};

		this.forgotPassword = function(user) {
			this.alert = false;
			this.loading = true;

			if(!self.user.email) {
				self.alert = {
					type: "error", 
					message: "Please enter your email to request a new password.", 
					code: 'PASSWORD_RESET_EMAIL'
				};
				self.loading = false;
			} else {
				AuthService.forgotPassword(self.user.email)
				.then(function () {
					self.alert = {
						type: "success", 
						message: "We've sent you a password email!", 
						code: 'PASSWORD_RESET'
					};
				})
				.catch(function (error) {
					self.alert = {
						type: "error", 
						message: error.message, 
						code: error.code
					};
				})
				.finally(function(){
					self.loading = false;
				});
			};
		};
	};

angular
	.module('login', [])
	.controller('LoginCtrl', [
		'$state', 
		'$timeout', 
		'AuthService', 
		'Restaurant',
		'$modal', 
		'$q',
		'Notification',
		LoginCtrl
	])

})();
